import React, { Component } from "react";
class Header extends Component{
    constructor(props){
        super(props),
        this.state={color:"Black"};
    }
    render(){
        return(
            <h1>My fav color{this.state.color}</h1>
        )
    }
} 
export default LifeCycle;
